WinRAR 3.91 beta2 x86 and x64 already Registered (Corporate).

Install it as the regular one and it works without need to use any KeyGen or Patch.

Only added the rarreg.key to the original setup, so you don't need to search for it. All the other files inside are the original ones, not patched, so you should not have any problem with Antiviruses.

If you don't trust it, download the original Setup from RarLabs Site and copy the RarReg.key file in the install Dir (usually C:Program FilesWinRAR), or use the included KeyGen to Register it.



WinRAR - What's new in the latest version


   Version 3.91 beta 2

   1. WinRAR might crash when testing corrupt CAB files.

   2. Beta 1 crashed on some of TAR.BZ2 archives.

   3. Total progress bar could be displayed incorrectly in &quot;Convert archives&quot;
      command in beta 1.

   4. SFX archives set the wrong value to &quot;sfxcmd&quot; environment variabe
      if user account control prompt was displayed when unpacking.


